1	sports	Sports Car Prices dataset	This dataset contains information about the prices of different sports cars from various manufacturers. The dataset includes the make and model of the car, the year of production, the engine size, the horsepower, the torque, the 0-60 MPH time, and the price in USD. The dataset is useful for analyzing the prices of different sports cars and identifying trends in the market.\n\nColumns\n\n**1.\tCar Make:** The make of the sports car, which represents the brand or company that produced the car. Examples of car makes in this dataset include Porsche, Lamborghini, Ferrari, Audi, and McLaren.\n\n**2.\tCar Model:** The model of the sports car, which represents the specific version or variant of the car produced by the manufacturer. Examples of car models in this dataset include 911, Huracan, 488 GTB, R8, 720S, M8, AMG GT, Corvette, Mustang Shelby GT500, and GT-R Nismo.\n\n**3.\tYear:** The year of production of the sports car, which indicates the model year when the car was first introduced or made available for purchase.\n\n**4.\tEngine Size (L):** The size of the sports car's engine in liters, which represents the volume of the engine's cylinders. A larger engine size typically indicates higher power and performance. Engine sizes in this dataset range from 2.0L to 8.0L, with some cars having electric motors instead.\n\n**5.\tHorsepower:** The horsepower of the sports car, which represents the power output of the car's engine. Higher horsepower typically indicates faster acceleration and higher top speed. Horsepower values in this dataset range from 300 to 1479.\n\n**6.\tTorque (lb-ft):** The torque of the sports car in pound-feet, which represents the rotational force generated by the engine. Higher torque values typically indicate stronger acceleration and better handling. Torque values in this dataset range from 270 to 1180.\n\n**7.\t0-60 MPH Time (seconds):** The time it takes for the sports car to accelerate from 0 to 60 miles per hour, which is a common measure of acceleration and performance. Lower 0-60 MPH times typically indicate faster acceleration and better performance. 0-60 MPH times in this dataset range from 1.85 to 5.3 seconds.\n\n**8.\tPrice (in USD):** The price of the sports car in US dollars, which represents the cost of purchasing the car. Prices in this dataset range from $25,000 to $3,000,000.\n\n** The purpose of creating this dataset is solely for educational use, and any commercial use is strictly prohibited\nand this dataset was large language models generated and not collected from actual data sources.\n\ncover image: https://www.pinterest.com/pin/357332551696985459/\n	kaggle	kaggle.com/datasets/rkiattisak/sports-car-prices-dataset	{beginner,intermediate,tabular,regression,"retail and shopping"}	{"Attribution 4.0 International (CC BY 4.0)"}	{"ï»¿Car Make","Car Model",Year,"Engine Size (L)",Horsepower,"Torque (lb-ft)","0-60 MPH Time (seconds)","Price (in USD)"}	1007	8	8056	13	1
2	education	Education in India	<div>\n<a href="https://link.rajanand.org/sql-challenges" target="_blank">\n<img src="https://link.rajanand.org/banner-01" alt="SQL Data Challenges" style="width: 700px; height: 120px"></a>\n</div>\n---\n\n### Context\n\nWhen India got independence from British in 1947 the literacy rate was 12.2% and as per the recent census 2011 it is 74.0%. Although it looks an accomplishment, still many people are there without access to education. \n\nIt would be interesting to know the current status of the Indian education system.\n\n### Content\n\nThis dataset contains district and state wise Indian primary and secondary school education data for 2015-16.\n\nGranularity: Annual\n\nList of files: \n\n 1. 2015_16_Districtwise.csv ( 680 observations and 819 variables )\n 1. 2015_16_Statewise_Elementary.csv ( 36 observations and 816 variables )\n 1. 2015_16_Statewise_Secondary.csv ( 36 observations and 630 variables  )\n\n \n\n### Acknowledgements\n\nMinistry of Human Resource Development (DISE) has shared the dataset [here](http://udise.in/src.htm) and also published some [reports](http://udise.in/AR.htm).\n\nSource of Banner [image](https://unsplash.com/photos/j9jZSqfH5YI).\n\n### Inspiration\n\nThis dataset provides the complete information about primary and secondary education. There are many inferences can be made from this dataset. There are few things I would like to understand from this dataset. \n\n1. Drop out ratio in primary and secondary education. (Govt. has made law that every child under age 14 should get free compulsary education.)\n2. Various factors affecting examination results of the students.\n3. What are all the factors that makes the difference (in literacy rate) between Kerala and Bihar?\n4. What could be done to improve the female literacy rate and literacy rate in rural area?\n\n---\n\n<div>\n<a href="https://link.rajanand.org/sql-challenges" target="_blank">\n<img src="https://link.rajanand.org/banner-02" alt="SQL Data Cha